import React from 'react';
import logo from './logo.svg';
import './App.css';
import Compass from "./components/compass"



class App extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div>
        <Compass width={200} height={200} heading={1}/>
      </div>
    );
  }
}

export default App;
